int turtle_actionlib_gencppROSMessageFactory::updateHeader(rframe::MessageBase &msg, unsigned int seqNo)
{
    int retval = rframe::Error::SUCCESS;

    switch (msg.id())
    {   
        // ShapeAction does not have a Header as its first member 
        case ShapeActionFeedback::ID:
        {
            Message<ShapeActionFeedback > & tempMsg = static_cast<Message<ShapeActionFeedback>&>(msg);
            rframe::Time t(rframe::Time::now());
            tempMsg.payload().header.seq = seqNo;
            tempMsg.payload().header.stamp.sec = t.sec();
            tempMsg.payload().header.stamp.nsec = t.nsec();
            break;
        } 
        case ShapeActionGoal::ID:
        {
            Message<ShapeActionGoal > & tempMsg = static_cast<Message<ShapeActionGoal>&>(msg);
            rframe::Time t(rframe::Time::now());
            tempMsg.payload().header.seq = seqNo;
            tempMsg.payload().header.stamp.sec = t.sec();
            tempMsg.payload().header.stamp.nsec = t.nsec();
            break;
        } 
        case ShapeActionResult::ID:
        {
            Message<ShapeActionResult > & tempMsg = static_cast<Message<ShapeActionResult>&>(msg);
            rframe::Time t(rframe::Time::now());
            tempMsg.payload().header.seq = seqNo;
            tempMsg.payload().header.stamp.sec = t.sec();
            tempMsg.payload().header.stamp.nsec = t.nsec();
            break;
        } 
        // ShapeGoal does not have a Header as its first member 
        // ShapeResult does not have a Header as its first member 
        // Velocity does not have a Header as its first member 
        default:
        {
            retval = rframe::Error::NOT_FOUND;
            break;
        }
    }

    return retval;
}
